import React from 'react';

import ReactCodeInput from 'react-verification-code-input';

const Verfication = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >  <h1>verfication</h1>
        <ReactCodeInput />
     
    </div>
  );
};

export default  Verfication ;
